import Navbar from './navbar';
import "../styles/header.css";

const Header = () => {
    return (
        <div className="header">
            <Navbar/>
            <div className="sliderContent">
                <img src="" alt="apple-headphones"/>
                <img src="" alt="brushbox-new"/>
                <img src="" alt="coffee-cup"/>
                <img src="" alt=""/>
                <img src="" alt=""/>
                <img src="" alt=""/>
            </div>
        </div>
    )
}
export default Header
